import React from 'react';

const Pagination = ({ todosPerPage, totalTodos }) => {
    const pageNumbers = [];
    for (let i = 0; i <= Math.ceil(Number(totalTodos) / Number(todosPerPage)); i++) {
        pageNumbers.push(i);
    }
    return (
        <nav>
            <ul className="mainSelect">
                {pageNumbers.map((number => (
                    <li key={number} className="mainSelect">
                        <a href="!#" className="mainSelect">
                            {number}
                        </a>
                    </li>
                )))}
            </ul>
        </nav>
    )
}

export default Pagination;
